    "assisted-housing-public-housing-authorities",nt"isopen": false,nt"url":
    null,nt"notes": "Public Housing was established to provide decent and safe
    rental housing for eligible low-income families, the elderly, and persons with disabilities.
    Public housing comes in all sizes and types, from scattered single family houses
    to high-rise apartments for elderly families. There are approximately 1.2 million
    households living in public housing units, managed by some 3,300 housing agencies
    (HAs). HUD administers Federal aid to local housing agencies (HAs) that manage the
    housing for low-income residents at rents they can afford. HUD furnishes technical
    and professional assistance in planning, developing and managing these developments.
    Public Housing Authorities are depicted as the physical location.",nt"license_title":
